import React from 'react';

export default function Cube () {
  return (
    <div style={{ height: '100px', width: '100px', position: 'relative'}}>
        <div className='face-front'
            style={{
                position: 'absolute',
                left: '0%',
                top: '25%',
                height: '50px',
                width: '43.3px',
                border:'solid',
                borderWidth:'0.1.px',
                transformStyle: 'preserve-3d',
                transform: 'skew(0deg, 30deg)'
            }}
        >
        </div>
        <div className='face-side'
            style={{
                position: 'absolute',
                left: '50%',
                top: '25%',
                height: '50px',
                width: ' 43.3px',
                border:'solid',
                borderWidth:'0.1.px',
                transformStyle: 'preserve-3d',
                transform: 'skew(0deg, -30deg)'
            }}
        >
        </div>
        <div className='face-top'
            style={{
                position: 'absolute',
                left: '16%',
                top: '-18%',
                height: '60px',
                width: '60px',
                border:'solid',
                borderWidth:'0.1.px',
                transformStyle: 'preserve-3d',
                transform: 'rotateX(60deg) rotateZ(45deg)'
            }}
        >
        </div>
    </div>
  );
}
